import React from 'react';
import Logo from './commons/Logo';
import HeaderUser from './HeaderUser';

function Header(porps) {
  return (
    <div className='header'>
      <div className='container'>
        <Logo />
        <HeaderUser />
      </div>
    </div>
  );
}

export default Header;
